create table phone
(
    id                 bigint  not null
        primary key,
    device_name        varchar(255),
    battery_life       integer not null,
    price              integer not null,
    year               integer not null,
    image_url          varchar(255),
    screen_size        real    not null,
    phone_url          varchar(255),
    has_nfc            boolean not null,
    has_headphone_jack boolean not null,
    has_dual_sim       boolean not null,
    has_ir             boolean not null,
    antutu_score       integer not null
);

alter table phone
    owner to noam;

